USE security;

CREATE TABLE `url_permission` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `url` varchar(500) DEFAULT NULL,
  `name` varchar(255) NOT NULL,
  PRIMARY KEY (`id`)
 ) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=utf8;
 
CREATE TABLE `role_url_permission` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `role_id` int(11) NOT NULL,
  `permission_id` int(11) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `role_url_per_fk1_idx` (`role_id`),
  KEY `role_url_per_fk2_idx` (`permission_id`)
 ) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=utf8;
 



USE `psm`;
DROP procedure IF EXISTS `csvballotaccountexport`;

DELIMITER $$
CREATE DEFINER=`root`@`%` PROCEDURE `csvballotaccountexport`(in token varchar(255),in electionid int)
BEGIN
	declare spcode varchar(45);
    declare username varchar(45);
    declare orgcode varchar(45);
    declare orgid int(11);
        
    set username=security.SPLIT_STR(token,'|',1);
    set orgcode=security.SPLIT_STR(token,'|',2);
    
    select id into orgid from subscription.organization where code=orgcode;
    
    if (security.fn_validate_token(token)=1 ) then
        update psm.election_close_stats
        set csv_export=1,csv_exporting_time=current_timestamp
        where organization_id=orgid and election_id=electionid;
        
        select 'success' as response;
    else
		select 'unauthorized' as response;
    end if;
END$$
DELIMITER ;

